INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 0.0, "キャル", 1, "2030/12/17 14:59:59", 0, 0.0, "2015/12/17 15:00:00", 1, 0, 106001, -363.0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 43, 43003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 0.0, "アメス", 1, "2030/12/17 14:59:59", 0, 0.0, "2015/12/17 15:00:00", 1, 0, 123001, -416.5, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", 44, 43004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 0.0, "アメス", 1, "2030/12/17 14:59:59", 0, 0.0, "2015/12/17 15:00:00", 2, 0, 123001, -416.5, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 44, 43005);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 0.0, "アメス", 2, "2030/12/17 14:59:59", 0, 5.79, "2015/12/17 15:00:00", 3, 0, 123001, -416.5, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 45, 43006);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (1, 0.0, "アメス", 1, "2030/12/17 14:59:59", 0, 0.0, "2015/12/17 15:00:00", 1, 0, 123001, -371.5, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 46, 46001);
